const DATA_URL = (
  `data:image/png;base64,`
).trim();

// 可能的精准选择器（按优先级依次尝试）
const SELECTORS = [
  '#sidebar-header > a[href="/"] > svg.icon-lg',
  '#sidebar-header > a[href="/"] > img'
];

function replaceNode(node) {
  if (!node || node.dataset?.customLogo === '1') return false;

  // 尺寸：优先取实际渲染尺寸，其次读 width/height 属性，最后兜底 24px
  let w = 24, h = 24;
  const r = node.getBoundingClientRect?.();
  if (r && r.width && r.height) { w = r.width; h = r.height; }
  else {
    const aw = parseInt(node.getAttribute?.('width') || '', 10);
    const ah = parseInt(node.getAttribute?.('height') || '', 10);
    if (aw && ah) { w = aw; h = ah; }
  }

  if (node.tagName === 'IMG') {
    if (node.src === DATA_URL) return false;
    node.src = DATA_URL;
    node.srcset = '';
    node.referrerPolicy = 'no-referrer';
    node.style.objectFit = 'contain';
    node.dataset.customLogo = '1';
    return true;
  }

  const img = document.createElement('img');
  img.src = DATA_URL;
  img.alt = 'ChatGPT';
  img.style.width = Math.round(w) + 'px';
  img.style.height = Math.round(h) + 'px';
  img.style.objectFit = 'contain';
  img.dataset.customLogo = '1';
  node.replaceWith(img);
  return true;
}

function tryReplace() {
  for (const sel of SELECTORS) {
    const node = document.querySelector(sel);
    if (node && replaceNode(node)) return true;
  }
  return false;
}

function boot() {
  tryReplace();
  // 监听 SPA 路由/DOM 变化，若节点被重建则再次替换（保持简单，无额外节流）
  new MutationObserver(tryReplace).observe(document.documentElement, { childList: true, subtree: true });
}

if (document.readyState === 'loading') {
  document.addEventListener('DOMContentLoaded', boot, { once: true });
} else {
  boot();
}
